import './SearchBar.css';

const SearchBar = (props) => {
    let searchClass = ""
    if (props.mode) {
        searchClass = "darksearch";
    }
    else {
        searchClass = '';
    }

    return(
        <div className={searchClass}>
            <input type="text" placeholder='Search for a country'></input>
        </div>
    )
}

export default SearchBar;
